import React, { Component } from 'react';
import { Tabs, Tab } from '@blueprintjs/core';

export default class Projects extends Component {
   state = {
      activeTabID: 1
   };
   handleTabChange = TabId => this.setState({ activeTabID: 1 });
   render() {
      return (
         <Tabs onchange={this.handleTabChange} large>
            <Tab id='1' title='Projects' panel={<div>Projects</div>} />
            <Tab
               id='2'
               title='Delivery Types'
               panel={<div>Delivery Types</div>}
            />
            <Tab id='3' title='Statuses' panel={<div>Statuses</div>} />
         </Tabs>
      );
   }
}
